// Imports
import Web3ContextProvider from "./context/Web3Context";
import { Routes, Route, Navigate } from "react-router";
import { lazy, Suspense } from "react";

// Components
import Navbar from "./components/Navbar";
import NotFound from "./components/NotFound";
import PageLoader from "./components/PageLoader";

// Styles
import "./styles/index.scss";



const Verify = lazy(() => import("./components/Verify"));
const Create = lazy(() => import("./components/Create"));
const Home = lazy(() => import("./components/Home"));
const Actions = lazy(() => import("./components/Actions"));
const About = lazy(() => import("./components/about"));

const App = () => {
	return (
		<Web3ContextProvider>
			<Navbar />
			<main>
									<Routes>
													<Route path="/">
																			<Route	exact path="create" element={<Suspense fallback={<PageLoader />}>
																						<Create />
																					</Suspense>
																				}
																			/>
																			<Route path="verify" element={<Suspense fallback={<PageLoader />}>
																						<Verify />
																					</Suspense>
																				}
																			/>
																			<Route exact path="/home" element={<Suspense fallback={<PageLoader />}>
																							<Home />
																					</Suspense>
																				}
																			/>
																			<Route exact path="actions" element={<Suspense fallback={<PageLoader />}>
																						<Actions />
																					</Suspense>
																				}
																			/>
																			<Route exact path="about" element={<Suspense fallback={<PageLoader />}>
																						<About />
																					</Suspense>
																				}
																			/>
																			<Route exact path="404" element={<NotFound />} />

																			<Route path="*" element={<Navigate to="/404" />} />
													</Route>
									</Routes>
			</main>

			<footer>
		    	<div>
									<h5><medium>~~  ASSETTO-BAZINGA &copy; Copyright 2022  ~~ </medium></h5>
							</div>
    </footer>
		</Web3ContextProvider>
	);
};

export default App;
